import React, { Component } from "react";

class Mobile extends Component {
  constructor(props) {
    super(props);
    this.state = {
      mabile: [
        {
          name: "Infinix X688C -32GB",
          price: "GH₵ 98.00",
          imgUrl:
            "https://gh.jumia.is/unsafe/fit-in/300x300/filters:fill(white)/product/76/275022/1.jpg?7723",
        },
      ],
    };
  }
  render() {
    return;
    <h1>Mobilephone</h1>;
  }
}

export default Mobile;
